const redTheme = {
	colors: {
		background: '#ffffff',
		opposite: '#272727',

		Primary: '#FFECEC',
		Secondary: '#FFBEBE',
		Tertiary: '#FF8D8D',
		Quaternary: '#E37272',
		Quinary: '#A75B5B',
	},
};

export default redTheme;
